import logo from './logo.svg';
import iphone from './ressources/iphonex.png';
import nature from './ressources/nature.jpg';

function Product(){
    return(

        <div class="card">
            <div class="card-header">
                <h5>6000 kr</h5> <small class="muted-text">Bergen</small>
                
            </div>
            <img src={iphone} class="card-img-top" alt="alt-image-cap" id="product-photo"/>
            <div class="card-body">
                <h4 class="card-title ">6000 kr</h4>
                <h6 class="card-text ">Pent brukt Iphone X</h6>
            </div>
        </div>

    
    );
}

export default Product;
